import React, { Component } from "react";
import { connect } from "react-redux";
import image from "../images/food1.jpg";
import { Row, Col, Nav } from "react-bootstrap";
import DropdownButton from "react-bootstrap/DropdownButton";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import Jumbotron from "react-bootstrap/Jumbotron";
import Container from "react-bootstrap/Container";
import "../App.css";
class Home extends Component {
  render() {
    return (
      <div
        className="homePage"
        style={{
          backgroundImage: `url(${image})`
        }}
      >
        <Navbar bg="primary" variant="dark">
          <Navbar.Brand href="/">GrubHub</Navbar.Brand>
          <Navbar.Collapse>
            <Nav className="ml-auto">
              <NavDropdown title="Sign In" id="SignIn">
                <NavDropdown.Item href="/">Customer</NavDropdown.Item>
                <NavDropdown.Item href="/">Owner</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Navbar>

        <Container>
          <div className="pt-5">
            <Jumbotron
              style={{
                background: `rgba(0, 0, 0, 0.5)`,
                color: `#f1f1f1`
              }}
            >
              <Container>
                <h1>Welcome To Spartan Grubhub</h1>
              </Container>
            </Jumbotron>
          </div>
        </Container>
      </div>
    );
  }
}

function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(Home);
